import React from 'react';

const SearchBar = () => {
    return (
        <div class="ui fluid search">
            <div class="ui icon input">
                <input class="prompt" type="text" placeholder="Search streams..."/>
                <i class="search icon"></i>
            </div>
            <div class="results"></div>
        </div>
    )
}

export default SearchBar;
